import React from "react";

// import { useSelector } from "react-redux";
import { useGetUsersQuery } from "../redux/slices/apiSlice";

import ActionButton from "./ActionButton";
import ModifyButton from "./ModifyButton";

import TableRow from "@mui/material/TableRow";
import TableCell from "@mui/material/TableCell";

const User = ({ position }) => {
  console.log(position)
  // const users = useSelector((state) => state.users);
  const { data } = useGetUsersQuery();
  // console.log(data)
  //if (isFetching) return "Loading"

  return (
    <TableRow>
      <TableCell>{data?.[position].firstName}</TableCell>
      <TableCell>{data?.[position].lastName}</TableCell>
      <TableCell>{data?.[position].email}</TableCell>
      <TableCell>{data?.[position].age}</TableCell>
      <TableCell>
        <ModifyButton action={"edit"} position={position} />
      </TableCell>
      <TableCell>
        <ActionButton
          position={position}
          action={"delete"}
          id={data?.[position].id}
        ></ActionButton>
      </TableCell>
    </TableRow>
  );
};

export default User;
